import React from "react";

export default function RespostaSimulacao(props) {

  const {combinacoesUnitarias, combinations, frete} = props;

  return (
    <div className="RespostaSimulacao">
      <div className="RespostaSimulacaoHeader">
        <img
          className="moneyIcon"
          src="https://static.vecteezy.com/system/resources/previews/011/660/689/original/3d-money-icon-illustration-png.png"
          alt="Ícone de dinheiro"
        />
        <h1 className="SimulacoesTitle">SIMULAÇÕES</h1>
        <img
          className="moneyIcon"
          src="https://static.vecteezy.com/system/resources/previews/011/660/689/original/3d-money-icon-illustration-png.png"
          alt="Ícone de dinheiro"
        />
      </div>


      {combinacoesUnitarias.map((produto, produtoIndex) => {
        return (
          <div className="combinacao" key={produtoIndex}>
            <div className="produto-da-combinacao" key={produtoIndex}>
              <h3>{produto.nome}  -  {produto.qtde} unidades</h3>
              <h4>Valor Custo: R${produto.custoUnitario.toFixed(2)}</h4>
              <h4>Valor Venda: R${produto.vendaUnitario.toFixed(2)}</h4>
              <h4>Volume: {produto.volume.toFixed(2)}m³</h4>
              <div key={`${produto.nome}-a`} className="valores">
                <div className="div-flex">
                  <h3 className="custo">CUSTO TOTAL: R${(produto.custoUnitario * produto.qtde).toFixed(2)}</h3>
                  <h3>LUCRO TOTAL: R${(produto.lucroUnitario * produto.qtde).toFixed(2)}</h3>
                </div>
                <div className="div-flex">
                  <h4>VOLUME: {produto.volume.toFixed(2)}m³</h4>
                  <h4>PESO: {produto.peso.toFixed(2)}Kg</h4>
                </div>
              </div>
            </div>
          </div>
        );
      })}



      {combinations
        .slice() // Copie o array para evitar a mutação do array original
        .sort((a, b) => {
          // Compare o custo total de cada combinação
          const custoTotalA = a[a.length - 3].SOMA_CUSTO + parseInt(frete);
          const custoTotalB = b[b.length - 3].SOMA_CUSTO + parseInt(frete);


          console.log(custoTotalA)
          return custoTotalA - custoTotalB;
        })
        .map((combinacao, index) => (
          <div className="combinacao" key={index}>
            {/* Renderizar lista de produtos */}
            {combinacao.map((produto, produtoIndex) => {
              if (produtoIndex < combinacao.length - 4) {
                return (
                  <div className="produto-da-combinacao" key={produtoIndex}>
                    <h3>{produto.nome}  -  {produto.qtde} unidades</h3>
                    <h4>Valor Custo: R${produto.custoUnitario}</h4>
                    <h4>Valor Venda: R${produto.vendaUnitario}</h4>
                    <h4>Volume: {produto.volume.toFixed(2)}m³</h4>
                  </div>
                );
              }
              return null;
            })}
            {/* Renderizar soma dos custos */}
            <div key={`${index}-valores`} className="valores">
              <div className="div-flex">
                <h3 className="custo">CUSTO TOTAL: R${(combinacao[combinacao.length - 3].SOMA_CUSTO + parseInt(frete)).toFixed(2)}</h3>
                <h3>LUCRO TOTAL: R${(combinacao[combinacao.length - 4].SOMA_LUCRO - parseInt(frete)).toFixed(2)}</h3>
              </div>
              <div className="div-flex">
                <h4>VOLUME: {(combinacao[combinacao.length - 2].SOMA_VOLUME).toFixed(2)}m³</h4>
                <h4>PESO: {(combinacao[combinacao.length - 1].SOMA_PESO).toFixed(2)}Kg</h4>
              </div>
            </div>
          </div>
        ))}

    </div>
  );
}
